  false,\n\t\"url\": null,\n\t\"notes\": \"Seier National Wildlife Refuge (NWR) was
  donated to the United States Fish and Wildlife Service (FWS) in 1999. Management
  of the refuge has primarily consisted of rest, with the exception of 1 site that
  has been grazed. This study was created to establish baseline data for the refuge.
  Our goals were to establish a baseline of current songbird use, including abundance
  and occupancy, of Seier NWR and a baseline of current vegetation structure and plant
  groupings. As prescribed management treatments are implemented to impact the species
  composition and structure of the grasslands on the refuge, habitat changes will
  presumably impact bird use of these grasslands in a somewhat predictable manner.
  This study will provide a basis for determining if birds respond as predicted.\",\n\t\"owner_org\":
